//cohost.org/amberisvibin/post/6339837-empty/edit","isLiked":true,"canShare":false,"canPublish":true,"limitedVisibilityReason":"none","astMap":{"spans":[],"readMoreIndex":null},"responseToAskId":null},{"postId":6339831,"headline":"","publishedAt":"2024-06-08T22:55:40.180Z","filename":"6339831-empty","transparentShareOfPostId":6338498,"shareOfPostId":6338498,"state":1,"numComments":3,"cws":[],"tags":[],"hasCohostPlus":false,"pinned":false,"commentsLocked":false,"sharesLocked":false,"blocks":[],"plainTextBody":"","postingProject":{"projectId":136235,"handle":"amberisvibin","displayName":"amber!","dek":"gayass goddess of tech and photos","description":"ask me about my computers or film cameras -\r\ntgirl tummy wonder\r\nyou may know me as catgirlthighhighs on Tumblr\n","avatarURL":"../rc/avatar/136235-2a21ef76-68ac-40de-9b4a-ffcfeed473e7-profile.jpeg","avatarPreviewURL":"../rc/avatar/136235-2a21ef76-68ac-40de-9b4a-ffcfeed473e7-profile.jpeg","headerURL":"../rc/header/136235-2afbaebf-db32-4dd2-b48b-dec248ce85f6-profile.gif","headerPreviewURL":"../rc/external/proxy-staging.cohostcdn.org/C3R4BsTiRXRKDn8EbVDgG4DVzCfVZPvgvA-aoeBEQ18/f%3Apng/czM6Ly9jb2hvc3QtcHJvZC9oZWFkZXIvMTM2MjM1LTJhZmJhZWJmLWRiMzItNGRkMi1iNDhiLWRlYzI0OGNlODVmNi1wcm9maWxlLmdpZg.png","privacy":"public","url":"https://ambersplace.github.io/","pronouns":"she/her","flags":[],"avatarShape":"circle","loggedOutPostVisibility":"public","frequentlyUsedTags":[],"askSettings":{"enabled":false,"allowAnon":false,"requireLoggedInAnon":true},"contactCard":[],"deleteAfter":null,"isSelfProject":true},"shareTree":[{"postId":6338498,"headline":"Look,","publishedAt":"2024-06-08T21:22:46.442Z","filename":"6338498-look","transparentShareOfPostId":null,"shareOfPostId":null,"state":1,"numComments":3,"cws":[],"tags":["I'm not looking for a new fc to join","please don't ask","I'm just tired of the current state of mmo community management"],"hasCohostPlus":true,"pinned":false,"commentsLocked":false,"sharesLocked":false,"blocks":[{"type":"markdown","markdown":{"content":"Back in my day, if the users on a big website wanted to make a mmo guild, they'd post a thread on the forums. People would sign up, and discuss the game in the thread and in game. Occasionally groups branched off into a dedicated irc room for the regulars who can't log in all the time to hang out with their guildmates. Very occasionally the guild leader would set up an  offsite forum that mostly no one posted on, but dkp was tracked on so it at least served some use."}},{"type":"markdown","markdown":{"content":"Topics of discussion had their natural ebbs and flows in game, in irc, on the thread. People would chat with each other about whatever as they were doing various tasks. Things felt like a community."}},{"type":"markdown","markdown":{"content":"Now when I join a big website free company, I have to go through discord, engage with a number of bots to \"apply\", join up, and find no one talks in game anymore. Everyone talks in the discord which has 80000 separate topic channels. You try to engage with a conversation only for an admin to stick their nose in and tell you to move it to a different channel. Now with discord threads, you can't even see all the topics of discussion unless you're hunting for them."}},{"type":"markdown","markdown":{"content":"It's not even like the main topic channel for the game you're all members of a free company in gets more than 50 lines of text a day in; heaven forbid a conversation drift to a different topic before being told to move over to a separate channel to make your offhand remarks in."}},{"type":"markdown","markdown":{"content":"This is absolutely the worst outcome from decades on community management evolution. "}}],"plainTextBody":"Back in my day, if the users on a big website wanted to make a mmo guild, they'd post a thread on the forums. People would sign up, and discuss the game in the thread and in game. Occasionally groups branched off into a dedicated irc room for the regulars who can't log in all the time to hang out with their guildmates. Very occasionally the guild leader would set up an  offsite forum that mostly no one posted on, but dkp was tracked on so it at least served some use.\n\nTopics of discussion had their natural ebbs and flows in game, in irc, on the thread. People would chat with each other about whatever as they were doing various tasks. Things felt like a community.\n\nNow when I join a big website free company, I have to go through discord, engage with a number of bots to \"apply\", join up, and find no one talks in game anymore. Everyone talks in the discord which has 80000 separate topic channels. You try to engage with a conversation only for an admin to stick their nose in and tell you to move it to a different channel. Now with discord threads, you can't even see all the topics of discussion unless you're hunting for them.\n\nIt's not even like the main topic channel for the game you're all members of a free company in gets more than 50 lines of text a day in; heaven forbid a conversation drift to a different topic before being told to move over to a separate channel to make your offhand remarks in.\n\nThis is absolutely the worst outcome from decades on community management evolution. ","postingProject":{"projectId":1427,"handle":"hkr","displayName":"Daria","dek":"","description":"[@imhkr](https://twitter.com/imhkr) on twitter\n\nlate 30s trans girl\n\nVideo Games, Retro tech,\n\nanime and tokusatsu nerd\n\nbehind the scenes @cathoderaydude\n\nFFXIV Daria Imhkr\\@Ultros\\\nFFXI Imhkr\\@bahamut\n\nArt by @dataerase\n\nAbandoned\r\n<https://bsky.app/profile/imhkr.bsky.social>\n","avatarURL":"../rc/avatar/1427-0dcd2048-75b3-43e3-a186-2d32e2ef992a-profile.PNG","avatarPreviewURL":"../rc/avatar/1427-0dcd2048-75b3-43e3-a186-2d32e2ef992a-profile.PNG","headerURL":null,"headerPreviewURL":null,"privacy":"public","url":"","pronouns":"she/her","flags":[],"avatarShape":"squircle","loggedOutPostVisibility":"public","frequent